    name: "Adetomiwa",
    tweet: "My people how una dey"
  }, {
    name: "Adedayo",
    tweet: "I need alcohol"
  }])

  return (
    <div className="App">
      <div className='home'>
        <Nav />
        <Tweets new ={arr.name} msg={arr.tweet}/>
      </div>
    </div>
  );
}

export default App;
